(6, 40, 'Welcome to Petland Iowa City: Our Story, Values, and What Makes Us Different', '<h1>Welcome to Petland Iowa City: Our Story, Values, and What Makes Us Different</h1><p><strong>By Ron, President and Co-Owner of Petland Iowa City</strong></p><h2>Why We Do What We Do</h2><p>Welcome to Petland Iowa City! I‚Äôm Ron, and together with my wife Wendy, we‚Äôve been serving the Iowa City community since 2006. Our journey began with a mission: to transform the pet industry from within. Instead of simply criticizing unethical practices like puppy mills, we decided to be part of the solution‚Äîraising the bar for responsible breeding and setting new standards for pet care and customer experience.</p><h2>Our Commitment to Community and Inclusion</h2><p>Giving back to our community is at the heart of Petland Iowa City. Wendy‚Äôs passion for making everyone feel welcome, especially individuals with special needs, comes from her own family experience as well as mine. We strive to create an inclusive, supportive environment where all guests‚Äîwhether first-time pet owners or lifelong animal lovers‚Äîfeel comfortable and valued.</p><h2>Experience You Can Trust: Our Story with Susie</h2><p>We‚Äôre pet lovers, just like you! Every puppy that arrives in our store captures our hearts, and sometimes, we can‚Äôt resist bringing one home. One of our favorite stories is about Susie, a tiny, white Maltipoo who won us over. Despite my efforts to find her a home before Wendy could take her home, Susie became part of our family‚Äîand today, at 17 years old, she‚Äôs still our little princess.</p><p>Susie taught us firsthand about the joys and challenges of puppy training. She was energetic and spirited, but with gentle techniques like the rollover method, she quickly learned to trust us. In just three days, she was cradled in our arms, showing that with patience and love, any puppy can become a cherished companion.</p><h2>Where Our Puppies Come From: Setting the Standard in Breeder Ethics</h2><p>One of the top questions we hear is, ‚ÄúWhere do your puppies come from?‚Äù We work exclusively with the most ethical breeders‚Äîthose who are Canine Care Certified through Purdue University or actively pursuing that certification. This means our breeders undergo rigorous third-party inspections, regular in-person visits, and must meet standards that far exceed the minimum requirements. We‚Äôve advocated for these high standards for years and are proud to implement them throughout our store.</p><h2>Your Puppy‚Äôs Health: Our Promise and Guarantees</h2><p>Your puppy‚Äôs health is our top priority. Every puppy receives weekly veterinarian checks, daily care, and a comprehensive health guarantee. If there‚Äôs ever an issue, we take responsibility and use it as an opportunity to improve our processes and support our breeders. For detailed information about our health protocols and guarantees, our knowledgeable Pet Counselors are always available to answer your questions.</p><h2>Lifetime Training Support and the Perfect Match</h2><p>Will your puppy be easy to train? We‚Äôre here to support you for a lifetime. Our team works hard to match each puppy with the right family, ensuring a smooth transition and a strong start for training. Our lifetime training support means you‚Äôll always have guidance, whether you‚Äôre working on basic commands or building a deeper bond with your pet. If Susie could go from wild puppy to loving lapdog, your new best friend can too!</p><h2>Visit Us: Experience the Petland Iowa City Difference</h2><p>Whether you‚Äôre exploring our website or visiting our store in person, you‚Äôre always welcome to come play with our puppies, ask questions, and discover what makes Petland Iowa City unique. Try out a few puppies, see who captures your heart, and know that Wendy and I have dedicated years to making your experience enjoyable, ethical, and full of joy.</p><p><strong>Ready to meet your new best friend? Stop by our store, play with our puppies, and let us help you find the perfect match! #puppy #petlandiowacity</strong></p><h2>About the Author</h2><p><strong>Ron</strong> is the President and Co-Owner of Petland Iowa City. With nearly two decades of hands-on experience in pet care, responsible breeding advocacy, and customer education, Ron is committed to improving industry standards and building a welcoming, inclusive community for all pet lovers.&nbsp;<a href=\"https://www.petlandiowacity.com/about-us\">Learn more about our team</a>.</p><h2>Learn More</h2><ul><li><a href=\"https://youtu.be/Ja8-6LnpYCw?si=wicf4w8lugaU5IZx\">Ron &amp; Wendy Welcome You To Petland Iowa City</a></li><li><a href=\"https://www.petlandiowacity.com/puppies-for-a-lifetime\">Puppies for a Lifetime Program</a></li><li><a href=\"https://www.petlandiowacity.com/puppy-training\">Puppy Training Resources</a></li><li><a href=\"https://www.petlandiowacity.com/contact\">Contact Us</a></li></ul><h2>Customer Reviews</h2><p>We‚Äôre proud of our positive reputation in Iowa City.&nbsp;<a href=\"https://www.google.com/maps/place/Petland+Iowa+City/@41.6438889,-91.5099806,16z/data=!3m1!4b1!4m6!3m5!1s0x87e46a6e45b253c1:0x1e1b55d3435821be!8m2!3d41.6438889!4d-91.5099806!16s%2Fg%2F1tqtyf8r?entry=ttu&amp;g_ep=EgoyMDI1MTAyNy4wIKXMDSoASAFQAw%3D%3D\">Read our latest customer reviews</a> and see why families trust us for their new best friends!</p>', 'Discover the story behind Petland Iowa City, our commitment to ethical breeders, health guarantees, lifetime training, and how we help you find the perfect puppy‚Äîall in a welcoming, community-focused environment.', '[{\"filename\":\"169 38.JPG\",\"drive_id\":\"1aBiTPSx3aH38-z0Dbv3dT7v8OZnDi3MN\",\"local_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/169_38.JPG\",\"thumb_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/thumbs\\/169_38.JPG\"},{\"filename\":\"169 34.JPG\",\"drive_id\":\"1tCsnlRpnsohLcU2CW9vGb4F8zopSblJv\",\"local_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/169_34.JPG\",\"thumb_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/thumbs\\/169_34.JPG\"},{\"filename\":\"169 32.JPG\",\"drive_id\":\"14Opg_Ndfr4xU5v2l_9e13AZCTlvxn7MH\",\"local_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/169_32.JPG\",\"thumb_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/thumbs\\/169_32.JPG\"},{\"filename\":\"169 27.JPG\",\"drive_id\":\"1Hye3TjZtF8ck8YzqaRGuFFONujvOxOYG\",\"local_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/169_27.JPG\",\"thumb_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/thumbs\\/169_27.JPG\"},{\"filename\":\"169 17.JPG\",\"drive_id\":\"1mW9oP-vfgLS8b0TqbQE3P_uWfqDK9kmr\",\"local_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/169_17.JPG\",\"thumb_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/thumbs\\/169_17.JPG\"},{\"filename\":\"169 3.JPG\",\"drive_id\":\"1Av_12DpKT_b15UCkhalaxUd6CQlNaAfU\",\"local_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/169_3.JPG\",\"thumb_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/thumbs\\/169_3.JPG\"},{\"filename\":\"169 1 mod.JPG\",\"drive_id\":\"1pc8UgEqiaSR3ynm3jK23jA62FRkDBurQ\",\"local_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/169_1_mod.JPG\",\"thumb_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/thumbs\\/169_1_mod.JPG\"}]', 'approved', '', '2025-10-30 13:32:38', '2025-12-05 19:29:21', '209.252.174.143'),
(7, 40, 'Achieving Ultimate Pet Wellness: A Holistic Guide to Quality of Life', '<p><a href=\"https://open.spotify.com/episode/6BcaGEDg1grIpH6gKSJSJV?si=u1BJL9kdRReXtAlbeKn3dg\">https://open.spotify.com/episode/6BcaGEDg1grIpH6gKSJSJV?si=u1BJL9kdRReXtAlbeKn3dg</a></p><p>here is a link to the podcast with this information, refer to this in your post!</p><p>&nbsp;</p><p>&nbsp;</p><p>The attachment, titled \"<strong>Petland Iowa City Pet Wellness Checklist</strong>,\" is a guide designed to help pet owners keep their companion animals \"healthy, happy, and thriving all year\".</p><p>&nbsp;</p><h3>Key Areas of the Checklist</h3><p>&nbsp;</p><p>The checklist organizes pet wellness into several distinct categories with specific recommendations:</p><p><strong>Veterinary Care:</strong> Includes annual wellness exams, staying up-to-date on <strong>core vaccinations</strong>, year-round parasite prevention (fleas, ticks, heartworm), and annual dental checkups.</p><p><strong>Nutrition &amp; Weight:</strong> Advises feeding a complete and balanced diet, measuring portions, limiting treats to less than <strong>10% of daily calories</strong>, and regularly monitoring weight.</p><p><strong>Dental Health:</strong> Recommends brushing teeth several times a week, providing dental chews/toys, and scheduling professional dental cleanings as needed.</p><p><strong>Exercise &amp; Enrichment:</strong> Suggests daily walks or play sessions (dogs), interactive toys (cats), rotating toys, and regular practice of training or new tricks.</p><p><strong>Grooming &amp; Hygiene:</strong> Covers regularly brushing the coat, bathing as needed, trimming nails every <strong>3‚Äì4 weeks</strong>, and cleaning ears.</p><p><strong>Comfort &amp; Home Safety:</strong> Notes include providing a clean, cozy bed, ensuring access to pet-proofed spaces, and keeping hazardous items out of reach.</p><p><strong>Record Keeping:</strong> Recommends maintaining a folder with medical records, vaccination dates, and emergency contacts, and noting any changes in health or behavior.</p><p>The checklist also includes a section for <strong>Senior Pet Care</strong>, recommending more frequent wellness exams and monitoring for changes in mobility, appetite, or behavior.</p><p>Would you like me to elaborate on the recommendations for any specific category, such as <strong>Veterinary Care</strong> or <strong>Nutrition &amp; Weight</strong>?</p>', 'It outlines key responsibilities across several categories:\r\n\r\n    Veterinary Care (annual exams, vaccines, parasite prevention).\r\n\r\nNutrition (complete diet, portion control, limiting treats to <10% of daily calories).\r\n\r\nDental Health (regular brushing, chews, professional cleanings).\r\n\r\nExercise & Enrichment (daily activity, training, socialization).\r\n\r\nGrooming (brushing, bathing, nail trims every 3‚Äì4 weeks).\r\n\r\nHome Safety (pet-proofing, providing a clean bed).', '[{\"filename\":\"Wellness Checklist Photo.jpg\",\"drive_id\":\"1XyQMEssIMgpjt_5-gBZ3v9VnGldfUBi2\",\"local_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/Wellness_Checklist_Photo.jpg\",\"thumb_path\":\"uploads\\/articles\\/40\\/2025\\/10\\/thumbs\\/Wellness_Checklist_Photo.jpg\"}]', 'approved', '', '2025-10-30 19:23:20', '2025-12-05 19:29:13', '75.221.11.235'),
(8, 40, 'Revised Blog for \"Paws for Wellness: Your Expert Guide to Pet Wellness Month\"', '<h2><strong>Paws for Wellness: Your Expert Guide to Pet Wellness Month</strong></h2><p><strong>By Petland Iowa City ‚Äì Your Trusted Local Pet Experts Since 2006</strong></p><p>October marks&nbsp;<strong>Pet Wellness Month</strong>, a time dedicated to helping our furry companions lead healthier, happier lives. At Petland Iowa City, we‚Äôve proudly served the Iowa City community for nearly two decades. Our commitment is built on a foundation of hands-on experience, professional staff training, and a deep passion for animal welfare.</p><p>This guide combines our practical knowledge from helping thousands of local families with authoritative advice from the nation\'s top veterinary experts.</p><h3><strong>üéß Hear It From Our Expert</strong></h3><p>Want to dive deeper into this topic? For even more hands-on advice, listen to the \"PAWSitively Petland Show,\" hosted by our very own Ron Solsrud. In a recent episode, Ron shares his decades of experience and discusses practical, real-world tips for keeping your pet healthy and happy.</p><p><strong>Listen Now:</strong><a href=\"https://open.spotify.com/episode/6BcaGEDg1grIpH6gKSJSJV?si=u1BJL9kdRReXtAlbeKn3dg\">&nbsp;<strong>The Ultimate Pet Wellness Checklist</strong></a></p><p><i>Available on Spotify and wherever you get your podcasts!</i></p><p>&nbsp;</p><p>&nbsp;</p><h3><strong>Why Pet Wellness Matters</strong></h3><p><strong>What is Pet Wellness?</strong></p><p>Pet wellness is a&nbsp;<strong>holistic approach</strong> to animal care. It goes beyond just treating sickness; it focuses on proactively supporting physical health, mental stimulation, balanced nutrition, and preventive medicine. According to the<a href=\"https://www.avma.org/resources/pet-owners/petcare/preventive-pet-healthcare\">&nbsp;<strong>American Veterinary Medical Association (AVMA)</strong></a>, preventive care and early detection are the most effective ways to give your pet a longer, healthier life.</p><p>Real-Life Experience: Susie\'s Story</p><p>We‚Äôve seen the power of wellness care firsthand. One of our beloved store mascots, a Maltipoo named Susie, is a vibrant 17 years old. Her long, happy life is a testament to a consistent wellness routine, quality nutrition, and regular veterinary care.</p><p>&nbsp;</p><p>&nbsp;</p><h3><strong>ü©∫ The Pillars of Pet Wellness</strong></h3><p><strong>1. Preventive Vet Care &amp; Checkups</strong></p><p>Annual Exams:</p><p>The&nbsp;<a href=\"https://www.aaha.org/wp-content/uploads/globalassets/02-guidelines/canine-life-stage-2019/2019-aaha-canine-life-stage-guidelines-final.pdf\"><strong>American Animal Hospital Association (AAHA)</strong></a> recommends annual or semi-annual wellness exams for all pets. These visits are your veterinarian\'s best chance to catch health issues before they become serious, update vaccinations, and keep your pet protected from common (and often costly) diseases.</p><p>Vaccinations &amp; Parasite Prevention:</p><p>Core vaccinations and year-round protection from fleas, ticks, and heartworm are non-negotiable for a healthy pet. Our team partners closely with local veterinarians to ensure every animal from Petland Iowa City is up-to-date and protected before they go to their new home. You can read more about&nbsp;<a href=\"https://www.petlandiowacity.com/ron-and-wendys-inspiring-journey-with-petland-iowa-city/\"><strong>our commitment to health</strong></a> on our website.</p><p><strong>2. Nutrition &amp; Weight Management</strong></p><p>A Balanced Diet:</p><p>Feeding a complete and balanced diet, as recommended by your veterinarian, is the cornerstone of long-term health. Obesity is a major health concern for pets, leading to issues like arthritis, diabetes, and heart disease. Portion control and providing&nbsp;<a href=\"https://www.petlandiowacity.com/videos/dog-cat-food-videos/\"><strong>healthy treats</strong></a> are crucial.</p><p>Expert Tip:</p><p>Always check food labels for an&nbsp;<a href=\"https://www.aafco.org/consumers/understanding-pet-food/\"><strong>AAFCO (Association of American Feed Control Officials) nutritional adequacy statement</strong></a>. This ensures the food you\'ve chosen meets established industry standards for your pet\'s life stage.</p><p><strong>3. Dental Health</strong></p><p>Why It Matters:</p><p>Did you know that dental disease affects over 80% of adult dogs and cats?&nbsp;<a href=\"https://avdc.org/dog-dental-health-advancements/\"><strong>The American Veterinary Dental College (AVDC)</strong></a> warns that poor dental health isn\'t just about bad breath‚Äîit can lead to chronic pain, infection, and even damage to your pet\'s heart, liver, and kidneys.</p><p>At-Home Care:</p><p>We educate all our new pet owners on the importance of dental care.</p><ul><li>Brush your pet‚Äôs teeth several times a week.</li><li>Offer safe, effective<a href=\"https://www.petlandiowacity.com/the-pretty-woman-guide-to-a-perfect-dog-smile/\">&nbsp;<strong>dental chews and toys</strong></a>.</li><li>Schedule professional cleanings as advised by your vet.</li></ul><p><strong>4. Exercise &amp; Enrichment</strong></p><p>Physical &amp; Mental Benefits:</p><p>Daily walks, active playtime, and&nbsp;<a href=\"https://www.facebook.com/share/r/1ASvPCG8se/\"><strong>interactive toys</strong></a> are essential for preventing obesity and boredom. But don\'t forget mental stimulation! Puzzle feeders, learning new tricks, or simply exploring a new path on your walk can significantly improve your pet\'s behavior and quality of life.</p><p><strong>Challenge:</strong> Try a new enrichment activity with your pet this week! Our staff loves exchanging creative ideas with the community.</p><p><strong>5. Behavioral &amp; Mental Wellness</strong></p><p>A healthy pet is more than just physically fit; they need to be mentally happy, too. This includes:</p><ul><li>Using positive reinforcement training.</li><li>Understanding your pet\'s<a href=\"https://www.avma.org/resources-tools/pet-owners/dog-bite-prevention\">&nbsp;<strong>body language</strong></a> to know when they\'re stressed or happy.</li><li>Providing a safe, predictable environment.</li></ul><p>If you\'re a new pet owner, establishing a gentle routine is key. Our<a href=\"https://www.facebook.com/watch/?v=2609548485921131\">&nbsp;<strong>on-site pet counselors</strong></a> are trained to help you with the basics of crate training, socialization, and house-training.</p><p><strong>6. Grooming &amp; Hygiene</strong></p><p>Routine care is preventive care. Regular brushing (to prevent matting), bathing, nail trims, and ear cleaning can prevent painful skin infections, parasites, and mobility issues. Our<a href=\"https://www.petlandiowacity.com/dog-grooming/\">&nbsp;<strong>in-store grooming team</strong></a> has decades of combined experience and is always happy to provide personalized tips for your pet‚Äôs specific breed and lifestyle.</p><p><strong>7. Senior Pet Wellness</strong></p><p>As pets age, their needs change. They often require:</p><ul><li>More frequent checkups to monitor for age-related conditions.</li><li>Joint support and supplements.</li><li>Dietary adjustments.</li><li>Extra comfort measures at home.</li></ul><p>We‚Äôve helped many senior pets‚Äîincluding those in our<a href=\"https://www.petlandiowacity.com/puppies-for-a-lifetime/\">&nbsp;<strong>Puppies for a Lifetime Program</strong></a>‚Äîenjoy their golden years with tailored, compassionate care.</p><p>&nbsp;</p><p>&nbsp;</p><h3><strong>Our Commitment to You</strong></h3><p>Our advice is rooted in trusted veterinary guidelines, decades of hands-on experience, and a genuine love for pets. We believe an educated pet owner is the best pet owner. Thank you for celebrating Pet Wellness Month with us!</p><p>For more expert tips, visit<a href=\"https://www.google.com/search?q=https://www.petlandiowacity.com/contact&amp;authuser=2\">&nbsp;<strong>Petland Iowa City in person</strong></a> or check out<a href=\"https://www.petlandiowacity.com/blog\">&nbsp;<strong>our blog</strong></a> online‚Äîand remember to share your pet wellness stories with our community!</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Authoritative Sources:</strong></p><ul><li><a href=\"https://www.aaha.org/\">American Animal Hospital Association (AAHA)</a></li><li><a href=\"https://www.aafco.org/\">Association of American Feed Control Officials (AAFCO)</a></li><li><a href=\"https://avdc.org/\">American Veterinary Dental College (AVDC)</a></li></ul>', 'Get expert tips for Pet Wellness Month from Petland Iowa City. Our complete guide covers preventive vet care, nutrition, dental health, and enrichment for a happy, healthy pet.', '[{\"filename\":\"169 38.JPG\",\"drive_id\":\"1qFLAq7slqmVuUwMfe1z0uybq_2aWMjEW\",\"local_path\":\"uploads\\/articles\\/40\\/2025\\/11\\/169_38.JPG\",\"thumb_path\":\"uploads\\/articles\\/40\\/2025\\/11\\/thumbs\\/169_38.JPG\"}]', 'approved', '', '2025-11-01 16:25:55', '2025-12-05 19:29:05', '209.252.174.143'),
(9, 44, 'The Power of the Human-Animal Bond: Petland Lewis Center visits Capri Gardens', '<p>This Veteran‚Äôs Day, Petland Lewis Center had the privilege of spending the afternoon at Capri Gardens Rehabilitation and Nursing Care for a very special puppy playdate. On November 11th, our team brought a little extra joy to the residents and staff with wagging tails, snuggles, and the magic of the human‚Äìanimal bond.</p><p>We were welcomed by staff and residents to meet the puppies. Our furry lineup included a Cavalier King Charles Spaniel, a Pomsky, a Shetland Sheepdog, a Schnoodle, and a Teddy Bear puppy. Each one brought their own charm, whether it was cuddles, playful energy, or, in the case of our Teddy Bear, showing off impressive leash-walking skills and a cute new haircut!</p><p>The visit was simple: free-form interaction, conversations, and lots of smiles. We shared fun facts about each breed and watched as residents lit up with each wag and kiss. Moments like these remind us just how powerful and healing the presence of animals can be.</p><p>This pop-up visit came together just a week in advance, and we‚Äôre already excited for the next one.</p><p>At Petland Lewis Center, our mission is rooted in celebrating and supporting the animal‚Äìhuman connection. Bringing joy, comfort, and companionship through moments like these is truly at the heart of what we do.</p>', 'Petland Lewis Center\'s visit to Capri Gardens Rehabilitation and Nursing Care!', '[{\"filename\":\"Capri Gardens 1.png\",\"drive_id\":\"1u4AEvO4hupwPRaEONJjbzDD31mgDAQ7x\",\"local_path\":\"uploads\\/articles\\/44\\/2025\\/11\\/Capri_Gardens_1.png\",\"thumb_path\":\"uploads\\/articles\\/44\\/2025\\/11\\/thumbs\\/Capri_Gardens_1.png\"},{\"filename\":\"Capri Gardens 2.png\",\"drive_id\":\"11xS7bptYHHINMxDZZGjcLXnVODG8DFxV\",\"local_path\":\"uploads\\/articles\\/44\\/2025\\/11\\/Capri_Gardens_2.png\",\"thumb_path\":\"uploads\\/articles\\/44\\/2025\\/11\\/thumbs\\/Capri_Gardens_2.png\"},{\"filename\":\"Ca