(105, 39, NULL, 'admin', NULL, 'Sent you both a Google Drive link with a note attached. Please let me know that you received it!  I know I am asking for raw vido, and we are currently battling the video upload issue in MediaHub, for now, feel free to drop any videos within the Google Drive I shared as a safeguard until MediaHub video uploads is fixed.', 0, NULL, NULL, '2025-10-24 18:00:24', 1, 0, 0, 0, 0, 0),
(106, 39, 19, 'store', NULL, 'Sorry for the delayed response! I just wanted to confirm that all of the material added is approved and safe to post!', 0, NULL, NULL, '2025-10-27 13:48:34', 1, 1, 0, 0, 0, 0),
(107, 39, NULL, 'admin', NULL, 'Okay great - I did speak with Carley on the video upload issue. If you have any pre-recorded videos on your devices that you want us to utilize, please add them to the Drive folder I shared with you all. Moving forward, all videos you want to add into MediaHub need to be recorded with modified Camera Settings. This will not impact the quality, but it will allow for the proper format to be uploaded to MediaHub. To update your Apple devices camera settings to submit in the most compatible format, navigate to settings, tap your camera settings.  Select format. Turn ON \"most compatible\". Be sure that Apple ProRes is toggled off.', 0, NULL, NULL, '2025-10-27 15:42:29', 1, 0, 0, 0, 0, 0),
(108, 41, 23, 'store', NULL, 'I\'m in!', 0, NULL, NULL, '2025-10-28 17:57:04', 1, 1, 0, 0, 0, 0),
(109, 40, NULL, 'admin', NULL, 'Hey Ron! I got your blog submission and I will work on getting this uploaded today. I noticed there were images in the blog but they are broken images can you please resend them through the content section?', 0, NULL, NULL, '2025-10-30 15:03:14', 1, 1, 0, 0, 0, 0),
(110, 39, NULL, 'admin', NULL, 'Hi Ladies! I have more content added to our Content Calendar. Please look at column E for anything titled NEEDS CLIENT APPROVAL. https://docs.google.com/spreadsheets/d/1zns2MMKCvKmaSe3wLLFS9S-7oBVgrkXDQrA0sj8H31E/edit?gid=0#gid=0', 0, NULL, NULL, '2025-10-30 15:25:18', 1, 0, 0, 0, 0, 0),
(111, 3, NULL, 'admin', NULL, 'Hi All!', 0, NULL, NULL, '2025-10-30 15:30:28', 1, 1, 0, 0, 0, 0),
(112, 39, 19, 'store', NULL, 'I will certainly take a look at that! Thank you!', 0, NULL, NULL, '2025-10-31 13:53:54', 1, 1, 0, 0, 0, 0),
(113, 39, NULL, 'admin', NULL, 'Hi Shannon! Have you had a chance to look at the latest content in our doc?', 0, NULL, NULL, '2025-11-05 22:06:31', 1, 0, 0, 0, 0, 0),
(114, 40, NULL, 'admin', NULL, 'Hey Ron the Welcome to Petland Iowa City: Our Story, Values, and What Makes Us Different blog is live and added to the breeder commitment page as well. Cassandra and her team will push it to your social media pages as well.', 0, NULL, NULL, '2025-11-06 19:24:34', 1, 1, 0, 0, 0, 0),
(115, 43, 27, 'store', NULL, 'Hey Cassandra - just testing!', 0, NULL, NULL, '2025-11-10 19:19:59', 1, 1, 0, 0, 0, 0),
(116, 43, NULL, 'admin', NULL, 'Hey! Received! I also saw your Photos with Santa material added, and will get them out ASAP!', 0, NULL, NULL, '2025-11-12 14:05:12', 1, 1, 0, 0, 0, 0),
(117, 43, 27, 'store', NULL, 'Thank you so much!', 0, NULL, NULL, '2025-11-12 19:34:27', 1, 1, 0, 0, 0, 0),
(118, 44, 31, 'store', NULL, 'Hello! If I want to submit a website pop-up, do I still use the old link? Also, where can I go to request a budget increase for a Black Friday sale that is going out on social media Wednesday? I am providing an email shortly with details :)', 0, NULL, NULL, '2025-11-24 15:23:27', 1, 1, 0, 0, 0, 0),
(119, 45, NULL, 'admin', NULL, 'Hi Bella! I saw some of the videos uploaded to MediaHub. Could you make sure that all videos taken are in vertical format for future? Meaning, full screen portrait, not landscape (like the Frenchie videos you uploaded). This will help us with creating the best visuals possible. Thank you!', 0, NULL, NULL, '2025-12-02 17:51:33', 1, 1, 0, 0, 0, 0),
(120, 45, 35, 'store', NULL, 'Hi, I\'m sorry to hear that. We‚Äôll do the next videos the way you‚Äôre requesting. For today, I‚Äôll be uploading some of the ones we just recorded to the platform, and they may not have the format you\'re asking for, but next time we‚Äôll definitely do our best. Thank you for your feedback!', 0, NULL, NULL, '2025-12-02 22:25:11', 1, 1, 0, 0, 0, 0),
(121, 45, 35, 'store', NULL, 'She is one of the girls who records the videos. If you need anything else, let me know.üòÄ', 0, NULL, NULL, '2025-12-02 22:26:44', 1, 1, 0, 0, 0, 0),
